import React from 'react';
import ReactDOM from 'react-dom';
import App from './component/App';
import Emojipedia from './Emojipedia';

const emojis = Emojipedia.filter(emoji => emoji.meaning.length < 100);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);

// Log the filtered emojis to the console
console.log(emojis);
